        id: 3,
        title: 'post 3',
        description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam eu tellus et magna ultricies elementum. Cras in suscipit purus. Sed lacinia justo ac pretium venenatis. Aliquam fermentum, lorem eu tincidunt facilisis, nibh sem blandit enim."
    }
]

const blogPosts = posts.map((item) => {
    return (
        <div class="post">
            <h2>{item.title}</h2>
            <p>{item.description}</p>
        </div>
    )
})

export const BlogContent = () => {
    return (
        <>
            <h1 className="pstatitle">Simple Blog</h1>
            <div class="posts">
                {blogPosts}
            </div>

            <div class="count">
                <button>Get amount of posts</button>
            </div>
        </>
    )
}
